function decryptCharcode(n,start,end,offset){n=n+offset;if(offset>0&&n>end){n=start+(n-end-1);}else{if(offset<0&&n<start){n=end-(start-n-1);}}return String.fromCharCode(n);}function decryptString(enc,offset){var dec="";var len=enc.length;for(var i=0;i<len;i++){var n=enc.charCodeAt(i);if(n>=43&&n<=58){dec+=decryptCharcode(n,43,58,offset);}else{if(n>=64&&n<=90){dec+=decryptCharcode(n,64,90,offset);}else{if(n>=97&&n<=122){dec+=decryptCharcode(n,97,122,offset);}else{dec+=enc.charAt(i);}}}}return dec;}function linkTo_UnCryptMailto(s){location.href=decryptString(s,-2);}